char* CharKeyboardJoin222(char* windowName = "", int maxInput = 21, char* defaultText = "") {
	WAIT(50);
	std::string gnirts = std::to_string(Settings::m_RIDJoinerTarget);
	int lengthh = gnirts.length();
	maxInput = lengthh;
	joinsessionp2 = new char[gnirts.length() + 1];
	strcpy(joinsessionp2, gnirts.c_str());
	defaultText = joinsessionp2;
	GAMEPLAY::DISPLAY_ONSCREEN_KEYBOARD(0, "", "", defaultText, "", "", "", maxInput);
	while (GAMEPLAY::UPDATE_ONSCREEN_KEYBOARD() == 0) WAIT(0);
	if (!GAMEPLAY::GET_ONSCREEN_KEYBOARD_RESULT()) return "0";
	return GAMEPLAY::GET_ONSCREEN_KEYBOARD_RESULT();
}

