// Convertir un tableau de pointeurs de caractères en un vecteur de chaînes de caractères
std::vector<std::string> charArrayToVector(const char* charArray[], size_t size) {
	std::vector<std::string> result;
	for (size_t i = 0; i < size; ++i) {
		result.push_back(charArray[i]); // Ajouter chaque élément au vecteur
	}
	return result;
}


